import React from 'react'
import '../css/footer.css';

const Footer = () => {
  return (
    <div className='footer'>
        <p>CARX Tours | build version: 0.5.9 | closed alpha test</p>
        <p>Открывать только по HTTPS. По HTTP фиксы ещё не были загружены</p>
    </div>
  )
}

export default Footer;
